import styled from "styled-components";
import { Link } from "react-router-dom";
import classes from './style.module.css';

const DivForUser = styled.div`
    width: 290px;
    height: 300px;
    margin: 12px;
    display: inline-block;
    background: hotpink;
`;
const ImgFromUser = styled.img`
    width: 100px;
    height: 100px;
    border-radius: 50%;
`;

const User = (props) => {
    const { user, path } = props;
    return ( 
        <DivForUser className={classes.user}>
            <ImgFromUser className={classes.userImg} src={user.img} />
            <h1 className={classes.namee}>{user.name}</h1>
            <h1 className={classes.username}>{user.username}</h1>
            <Link to={path} className={classes.path}>see user</Link>
        </DivForUser>
    );
};

export { User };
